import React, { useState, useEffect } from 'react';
import { ThemeProvider } from 'styled-components';
import { RangeSlider } from './RangeSlider';
import { MultiSelect } from './MultiSelect';
import { DateRangePicker } from './DatePicker';
import { fetchAirtableData } from '../services/airtable';
import { lightTheme, darkTheme } from '../themes/themes';
import styled from 'styled-components';
import { handleSubmit } from '../services/formHandler';

const DashboardContainer = styled.div`
    background: ${props => props.theme.body};
    min-height: 100vh;
    color: ${props => props.theme.text};
    padding: 2rem;
    font-family: 'Rajdhani', sans-serif;
`;

const FilterGrid = styled.div`
    display: grid;
    grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
    gap: 2rem;
    margin-top: 2rem;
`;

const FilterSection = styled.div`
    background: ${props => props.theme.cardBg};
    border: 1px solid ${props => props.theme.cardBorder};
    border-radius: 10px;
    padding: 1.5rem;
    backdrop-filter: blur(10px);
`;

const ThemeToggle = styled.button`
    position: fixed;
    top: 2rem;
    right: 2rem;
    background: ${props => props.theme.accent};
    color: ${props => props.theme.cardBg};
    border: none;
    border-radius: 50%;
    width: 50px;
    height: 50px;
    cursor: pointer;
    box-shadow: 0 0 15px ${props => props.theme.shadowColor};
    transition: all 0.3s ease;

    &:hover {
        transform: scale(1.1);
    }
`;

const SubmitButton = styled.button`
    background: ${props => props.theme.accent};
    color: ${props => props.theme.cardBg};
    border: none;
    border-radius: 10px;
    padding: 1rem 2rem;
    font-size: 1.2rem;
    cursor: pointer;
    margin-top: 2rem;
    transition: all 0.3s ease;
    box-shadow: 0 0 15px ${props => props.theme.shadowColor};

    &:hover {
        transform: translateY(-2px);
        box-shadow: 0 5px 20px ${props => props.theme.shadowColor};
    }

    &:active {
        transform: translateY(0);
    }
`;

const DashboardInterface = () => {
    const [data, setData] = useState(null);
    const [isDarkTheme, setIsDarkTheme] = useState(true);
    const [filters, setFilters] = useState({
        phase: [0, 100],
        division: [0, 100],
        wbsCategory: [],
        duration: [0, 100],
        percentComplete: [0, 100],
        startDate: null,
        endDate: null
    });

    useEffect(() => {
        const loadData = async () => {
            const airtableData = await fetchAirtableData();
            setData(airtableData);
            if (airtableData?.ranges) {
                setFilters(prev => ({
                    ...prev,
                    phase: airtableData.ranges.phase,
                    division: airtableData.ranges.division,
                    duration: airtableData.ranges.duration,
                    percentComplete: airtableData.ranges.percentComplete
                }));
            }
        };
        loadData();
    }, []);

    const onSubmit = async () => {
        const result = await handleSubmit(filters);
        // Handle the result as needed
    };

    return (
        <ThemeProvider theme={isDarkTheme ? darkTheme : lightTheme}>
            <DashboardContainer>
                <ThemeToggle onClick={() => setIsDarkTheme(!isDarkTheme)}>
                    {isDarkTheme ? '☀️' : '🌙'}
                </ThemeToggle>
                <h1>Project Analytics Interface</h1>
                <FilterGrid>
                    <FilterSection>
                        <h3>Phase Range</h3>
                        <RangeSlider
                            value={filters.phase}
                            onChange={(value) => setFilters({ ...filters, phase: value })}
                            min={data?.ranges?.phase[0]}
                            max={data?.ranges?.phase[1]}
                        />
                    </FilterSection>

                    <FilterSection>
                        <h3>Division Range</h3>
                        <RangeSlider
                            value={filters.division}
                            onChange={(value) => setFilters({ ...filters, division: value })}
                            min={data?.ranges?.division[0]}
                            max={data?.ranges?.division[1]}
                        />
                    </FilterSection>

                    <FilterSection>
                        <h3>WBS Category</h3>
                        <MultiSelect
                            options={data?.wbsCategories || []}
                            value={filters.wbsCategory}
                            onChange={(value) => setFilters({ ...filters, wbsCategory: value })}
                        />
                    </FilterSection>

                    <FilterSection>
                        <h3>Duration Range</h3>
                        <RangeSlider
                            value={filters.duration}
                            onChange={(value) => setFilters({ ...filters, duration: value })}
                            min={data?.ranges?.duration[0]}
                            max={data?.ranges?.duration[1]}
                        />
                    </FilterSection>

                    <FilterSection>
                        <h3>Completion Percentage</h3>
                        <RangeSlider
                            value={filters.percentComplete}
                            onChange={(value) => setFilters({ ...filters, percentComplete: value })}
                            min={data?.ranges?.percentComplete[0]}
                            max={data?.ranges?.percentComplete[1]}
                        />
                    </FilterSection>

                    <FilterSection>
                        <h3>Date Range</h3>
                        <DateRangePicker
                            startDate={filters.startDate}
                            endDate={filters.endDate}
                            onChange={({ start, end }) => setFilters({
                                ...filters,
                                startDate: start,
                                endDate: end
                            })}
                        />
                    </FilterSection>
                </FilterGrid>
                <SubmitButton onClick={onSubmit}>
                    Apply Filters
                </SubmitButton>
            </DashboardContainer>
        </ThemeProvider>
    );
};

export default DashboardInterface;
